import React from "react";

const Clock = () => {
  return (
    <svg
      width="1em"
      height="1em"
      viewBox="0 0 16 16"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      focusable="false"
      role="img"
    >
      <path
        d="M7.5 3.333v4.874l2.813 2.813.707-.707-2.52-2.52v-4.46h-1z"
        fill="currentColor"
      ></path>
      <path
        fillRule="evenodd"
        clipRule="evenodd"
        d="M8 16A8 8 0 108 0a8 8 0 000 16zm7-8A7 7 0 111 8a7 7 0 0114 0z"
        fill="currentColor"
      ></path>
    </svg>
  );
};

export default Clock;
